import { createSlice } from "@reduxjs/toolkit";
import { getFreelancers } from "../actions/freelancerActions";

const initialState = {
  loading: false,
  error: null,
  freelancerList: [],
  oneFrelancer: null,
  pages: 1,
};

export const freelancerSlice = createSlice({
  name: "freelancers",
  initialState,
  reducers: {},
  extraReducers: {
    [getFreelancers.fulfilled]: (state, action) => {
      state.loading = false;
      state.freelancerList = action.payload.results;
    },
    [getFreelancers.pending]: (state, action) => {
      state.loading = true;
    },
    [getFreelancers.rejected]: (state, action) => {
      state.loading = false;
      state.error = action.payload;
    },
  },
});

export const {} = freelancerSlice.actions;

export const freelancerReducer = freelancerSlice.reducer;
